"use strict";

import React, {Component} from "react";

import {NavLink} from "react-router-dom";

const Navbar = (props) => {
    const {display} = props,
        navDisplay = `display: ${display}`;

    return (
        <nav className="bg-black-transparent w-9/12 rounded-full mx-auto p-1.5">
            <div className="my-5 mx-2">
                <NavLink to="/login"
                        className="text-white text-lg rounded-full bg-tahiti hover:bg-tahiti-dark py-5 px-8 {display}" style={navDisplay}>Личный
                    кабинет
                </NavLink>
            </div>
        </nav>
    )
}

export default Navbar;
